Explanation:

- I examined EmployeeController.getEmployees which is mapped to GET /documents/{id}.
- The method returns three distinct HTTP status codes explicitly:
  - 200 OK when the document is served. The response body is a FileSystemResource wrapping a File, and the code sets the Content-Type to "application/pdf" and adds a "Content-Disposition" header (inline;filename={name}.pdf) and a "Cache-Control" header ("must-revalidate, post-check=0, pre-check=0"). In Swagger 2.0, a file response is represented with a response schema of type "file".
  - 404 NOT_FOUND when the Document object is null. The code sets Content-Type to application/json for this response but does not include a response body.
  - 401 UNAUTHORIZED when the requesting employee's printshop id does not match the document's printshop id. The code sets Content-Type to application/json for this response but does not include a response body.
- Although Spring Security @Secured may cause other authentication/authorization responses at a filter level, I included only the responses explicitly produced by the controller method (200, 401, 404).
- The response objects below contain descriptions, and for the 200 response a schema of type "file" plus header descriptions for Content-Disposition, Cache-Control, and Content-Type to reflect the headers set by the controller. The 401 and 404 responses include descriptive messages noting the Content-Type set in the controller.

